import React, { useState } from "react";

const axios = require("axios");

export default function ModelApi(props) {
  const [data, setData] = useState({ hits: [] });
  const [modelResponse, setModelResponse] = useState([]);
  const [params, setParams] = useState({
    chosenTime: parseInt(props.timeDayMonth[0]),
    chosenDay: props.timeDayMonth[1],
    chosenMonth: props.timeDayMonth[2],
  });
  const [url, setUrl] = useState(`/api/model_result`, {
    params,
  });

  React.useEffect(() => {
    const fetchData = async () => {
      const result = await axios.get(url).then((res) => {
        const modelResponse = res.data;
        setModelResponse(modelResponse);
        console.log("setModelResponse has been triggered");
      });

      setData(result.data);
    };

    fetchData();
  }, [url]);

  return (
    <div>
      <p>
        This journey is estimated to take {modelResponse.model_response} minutes
      </p>
    </div>
  );
}
